import React from 'react';

const Header = () => {
  return (
    <div className="nav">
      <nav className="dt w-100 border-box pa3 ph5-ns">
        <div className="dtc v-mid w-75 tr">
          <a href="#click">Click here</a>
        </div>
      </nav>
    </div>
  );
}

export default Header;
